import styles from './agendamentform.module.css';
import Inputt from '../form/Input';
import SubmitButton from '../form/SubmitButton';

function AgendamentForm() {


  return (
    <form className={styles.form}>
      <Inputt type="text" text="Nome do pet" />
      <Inputt type="text" text="Nome do Tutor" name="nomeTutor"  />
      <Inputt type="text" text="Idade do Pet" name=""/>
      <Inputt type="number" text="Numero de celular" name="celular"  />
      <Inputt type="text" text="Email" name="email"  />
      <Inputt type="number" text="CEP" name="cep"  />
      <Inputt type="text" text="Rua" name="rua"  />
      <Inputt type="number" text="Número" name="numero"  />
      <Inputt type="text" text="Cidade" name="cidade"  />
      <Inputt type="text" text="Estado" name="estado"  />
      <Inputt type="text" text="O que está acontecendo com o pet?" name="motivo"  />
      <Inputt type="date" text="Data da Consulta" name="dataConsulta"  />
      <Inputt type="time" text="Horario da Consulta" name="horaConsulta"  />
      <SubmitButton text="Agendar Consulta" />
    </form>
  );
}

export default AgendamentForm;
